import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
var dog_food_data = {
    "Taste of The Wild" : [
        {
            name: "High Prairie Canine Recipe with Roasted Bison & Roasted Venison",
            protein: 32.0,
            fat: 18.0,
            calorie: 3719,
        },
        {
            name: "Pine Forest Canine Recipe with Venison & Legumes",
            protein: 28.0,
            fat: 15.0,
            calorie: 3600,
        },
        {
            name: "Southwest Canyon Canine Recipe with Wild Boar",
            protein: 29.0,
            fat: 15.0,
            calorie: 3600,
        }
    ],
    "Blue Buffalo" :[
        {
            name: "Life Protection Formula® Chicken and Brown Rice Recipe (For Puppies)",
            protein: 27.0,
            fat: 16.0,
            calorie: 3686,
        },
        {
            name: "FacebookTwitterPinterest Life Protection Formula® Fish and Brown Rice Recipe",
            protein: 22.0,
            fat: 14.0,
            calorie: 3619,
        }
    ],
    "Diamond Naturals" : [
        {
            name: "FacebookTwitterPinterest Life Protection Formula® Fish and Brown Rice Recipe",
            protein: 22.0,
            fat: 14.0,
            calorie: 3619,
        }
    ]
}
class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Dog food comparison calculator</h1>
        <div>
            <p>Dr. Shmalberg says: We should feed by calorie, not by weight. Percentages on commercial dog food labels are not reliable because they are based on weight, and the values are affected by many factors, including moisture, fiber and minerals.</p>
        </div>
          <p>Use this calculator to get a more accurate picture of how another dog food brand compares with NomNomNow.

          </p>
      </div>
    );
  }
}

export default App;
